  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is a single orthophoto from
  a collection of GeoTIFF format, natural-color orthophotos covering Collier County,
  Florida. An orthophoto is remotely sensed image data in which displacement of features
  in the image caused by terrain relief and sensor orientation have been mathematicallyremoved.
  Orthophotography combines the image characteristics of a photograph with the geometric
  qualities of a map. Each orthophoto provides imagery for a 4500- by 4500-foot block
  on the ground at 0.5 foot pixel resolution. The projected coordinate system is State
  Plane, Florida East (FIPS 901), NAD83, Survey Feet. There is no image overlap in
  adjacent files. The imagery was captured using Zeiss/Intergraph Digital Mapping
  Camera (DMC). The county's existing LIDAR dataset collected in 2001 and 2005 were
  used as a DEM surface for the orthorectification process. The orthophotos are available
  in GeoTIFF and MrSID compressed forms.\",\n\t\"owner_org\": \"b0b4c45b-a8ca-416b-b463-ee90d0a1a3df\",\n\t\"extras\":
